(require '[clojure.string :as string])

(defn parse-int
  [input]
  (Integer/parseInt input)
  )

(defn get-all-numbers-in-line
  [line]
  (map parse-int (string/split line #"\s"))
  )

(defn is-collection-around-index-sorted-with-diff-less-than
  [collection index acceptable-difference]
  (let [diff (- (nth collection index) (nth collection (- index 1)))]
    (or (< acceptable-difference (abs diff))
        (= 0 diff)
        (and (< index (- (count collection) 1)) (> 0 (* diff (- (nth collection (+ index 1)) (nth collection index))))))
  )
  )

(defn collection-without-element-at
  [collection index]
  (concat (take index collection) (drop (+ index 1) collection))
  )

(defn is-safe
  [collection can-fail]
  (let [is-safe-without-current #(is-safe (collection-without-element-at collection %1) false)
        is-safe-without-next #(is-safe (collection-without-element-at collection (+ %1 1)) false)
        is-safe-without-previous #(is-safe (collection-without-element-at collection (- %1 1)) false)]

    (loop [index (- (count collection) 1)
           has-failed false]

      (if (or (< index 1) has-failed)
        (not has-failed)
        (let [is-fail (is-collection-around-index-sorted-with-diff-less-than collection index 3)]
          (recur (dec index)
                 (and is-fail (or
                                (not can-fail)
                                (not (or
                                       (is-safe-without-current index)
                                       (is-safe-without-next index)
                                       (is-safe-without-previous index)))))
                 ))
        )
      )
    )
  )


(defn day2-part1
  [input]
  (count (filterv #(= true %) (for [line (string/split input #"\n")] (is-safe (get-all-numbers-in-line line) false))))
  )

(defn day2-part2
  [input]
  (count (filterv #(= true %) (for [line (string/split input #"\n")] (is-safe (get-all-numbers-in-line line) true))))
  )

